import React, { Component } from 'react';
import {Link} from "react-router-dom";

class VideoSection extends  Component {

    addup = () => {
      alert('it works')
      // this.setState({
      //   thumbsUp: videos.thumbsUp + 1
      // });
    }


    render() {
      // let videoslist=this.props.videosDisplay;
      let videos= this.props.videosobject;
      console.log(videos)


      return (
      // <Link to={"/videos/e5bc244e-be4c-4925-acce-3e3aa7069706}"}>
        <section className="video__section">
          <video
            controls poster={videos.image}
            src= {videos.video} 
            type="video/mp4">
            Your browser does not support HTML5 video.
          </video>

          <p>{videos.title}</p>
          <div className="video__section--comments">
            <p className="video__section--views"></p>
            <div className="video__section--icons">
              <div>
              {/* onClick= {this.props.addup} */}
                <img onClick= {this.addup} className="up" src="/Assets/Icons/Thumbs Up.svg" ></img>
                <h5>{videos.thumbsUp}</h5>              
              </div>
              <div>
                <img className="down" src="/Assets/Icons/Thumbs Down.svg" ></img>
                <h5>{videos.thumbsDown}</h5>
              </div>
              <div>
                <img className="share" src="/Assets/Icons/Share.svg"></img>
                <h5>SHARE</h5>
              </div>
            </div>
          </div>
        </section>
      // </Link>  
      );
    }
  }

export default VideoSection;
